import MagneticWrapper from "./components/magneticWrapper";
import "./App.css";

function App() {
  return (
    <div className="App">
      <MagneticWrapper>
        <div
          style={{
            background: "rebeccapurple",
            color: "white",
            padding: "50px 100px",
          }}
        >
          Matilda
        </div>
        <iframe src="www.google.com"></iframe>
      </MagneticWrapper>
    </div>
  );
}

export default App;
